#include <SoftwareSerial.h>
#include <Servo.h>

#define servoPin 9
#define escMotorPin 12
// הגדרות פינים קבועות
const int PIN_RX = 10;
const int PIN_TX = 11;
const int M0 = 7;
const int M1 = 8;

SoftwareSerial loraSerial(PIN_RX, PIN_TX);
Servo steeringServo;
Servo escMotor;

// מבנה נתונים ארוז - חייב להיות זהה לשלט
struct __attribute__((packed)) ControlData {
  byte header;    // 0xAA
  byte throttle;  // 0-255
  byte steering;  // 0-255
  byte trimT;     // 0-255
  byte trimS;     // 0-255
  byte checksum;  
};

ControlData receiverdat;
unsigned long lastPacketTime = 0; 
bool connected = false;

// ערכים סופיים לפקודות (גלובליים כדי שיהיו נגישים לכל הקוד)
int finalThrottle = 127;
int finalSteering = 127;
int escSignal = 1500;      // Ajouté ici pour être global
int steeringSignal = 1500;

void setup() {
  steeringServo.attach(servoPin);
  escMotor.attach(escMotorPin);
  // הגדרת מצבי עבודה למודול LoRa
  pinMode(M0, OUTPUT);
  pinMode(M1, OUTPUT);
  digitalWrite(M0, LOW);
  digitalWrite(M1, LOW);

  Serial.begin(115200);
  loraSerial.begin(9600);
  Serial.println("System Initialized. Waiting for Remote...");
  
  // אתחול זמן ראשוני כדי למנוע כניסה מיידית ל-Failsafe
  lastPacketTime = millis();
}

void loop() {
  // 1. ניקוי באפר במקרה של הצטברות "זבל" אלקטרוני
  if (loraSerial.available() > 30) {
    while (loraSerial.available()) loraSerial.read();
  }

  // 2. קליטת נתונים ואימות
  if (loraSerial.available() >= sizeof(ControlData)) {
    byte potentialHeader = loraSerial.read();
    
    if (potentialHeader == 0xAA) {
      byte* structPtr = (byte*)&receiverdat;
      structPtr[0] = potentialHeader;
      
      loraSerial.readBytes(&structPtr[1], sizeof(ControlData) - 1);

      // אימות מתמטי של החבילה
      byte calculatedChecksum = receiverdat.throttle + receiverdat.steering + 
                                 receiverdat.trimT + receiverdat.trimS;

      if (calculatedChecksum == receiverdat.checksum) {
        // סימון קשר תקין ועדכון זמן
        lastPacketTime = millis();
        
        if (!connected) {
          connected = true;
          Serial.println(">>> LINK ESTABLISHED <<<");
        }

        // א. חישוב ערכים סופיים כולל טרמים (מרכז ב-127)
        finalThrottle = receiverdat.throttle + (receiverdat.trimT - 127);
        finalSteering = receiverdat.steering + (receiverdat.trimS - 127);

        // ב. הגבלת הטווח ל-0-255
        finalThrottle = constrain(finalThrottle, 0, 255);
        finalSteering = constrain(finalSteering, 0, 255);

        // ג. החלת Deadzone (שטח מת) למניעת זמזום במנוחה
        if (finalThrottle > 123 && finalThrottle < 131) finalThrottle = 127;
        if (finalSteering > 123 && finalSteering < 131) finalSteering = 127;

        escSignal = map(finalThrottle, 0, 255, 1000, 2000);
        escMotor.writeMicroseconds(escSignal);

        steeringSignal = map(finalSteering, 0, 255, 1000, 2000);
        steeringServo.writeMicroseconds(steeringSignal);

        // דוגמה להדפסת הנתונים הסופיים
        printStatus();
      }
    }
  }

  // 3. מנגנון Failsafe דינמי (עצירה אם אין קשר מעל 1.5 שניות)
  if (millis() - lastPacketTime > 1500) {
    if (connected) {
      connected = false;
      Serial.println("!!! LINK LOST - FAILSAFE ACTIVATED !!!");
    }
    
    finalThrottle = 127; // עצירה
    finalSteering = 127; // יישור גלגלים
    
    // מניעת הצפה של ה-Serial Monitor
    lastPacketTime = millis() - 1400; 
  }
}

// פונקציית עזר להדפסת נתונים
void printStatus() {
  static unsigned long lastPrint = 0;
  if (millis() - lastPrint > 300) { // הדפסה פעם ב-200 מילי-שניות בלבד
    // נתונים גולמיים מהשלט (Raw)
    Serial.print("RAW -> Thr: "); Serial.println(receiverdat.throttle);
    Serial.print("Str: "); Serial.println(receiverdat.steering);
    //Serial.print("TrimT: "); Serial.println(receiverdat.trimT);
    //Serial.print("TrimS: "); Serial.println(receiverdat.trimS);
    Serial.println("____________");
    //Serial.print("T_Total: "); Serial.print(finalThrottle);
    //Serial.print(" | S_Total: "); Serial.println(finalSteering);
    //Serial.println("____________");
    Serial.print("ESC_Signal: "); Serial.println(escSignal);
    Serial.print("STERRING_Signal: "); Serial.println(steeringSignal);
    Serial.println("____________");
    lastPrint = millis();
  }
}

#include <SoftwareSerial.h>

// הגדרות פינים
const int PIN_RX = 10;
const int PIN_TX = 11;
const int M0 = 7;
const int M1 = 8;

// פינים אנלוגיים לג'ויסטיקים וטרמים
const int POT_THROTTLE = A0;
const int POT_STEERING = A1;
const int POT_TRIM_T = A2;
const int POT_TRIM_S = A3;

SoftwareSerial loraSerial(PIN_RX, PIN_TX);

// מבנה נתונים ארוז - חייב להיות זהה למקלט
struct __attribute__((packed)) ControlData {
  byte header;    // 0xAA
  byte throttle;  // 0-255
  byte steering;  // 0-255
  byte trimT;     // 0-255
  byte trimS;     // 0-255
  byte checksum;  
};

ControlData transmitterdat;

void setup() {
  // הגדרת מצב עבודה למודול LoRa (Normal Mode)
  pinMode(M0, OUTPUT);
  pinMode(M1, OUTPUT);
  digitalWrite(M0, LOW);
  digitalWrite(M1, LOW);

  Serial.begin(115200);
  loraSerial.begin(9600);

  Serial.println("Transmitter Ready - Broadcasting...");
  
  // הגדרת ה-Header פעם אחת (הוא לעולם לא משתנה)
  transmitterdat.header = 0xAA;
}

void loop() {
  // 1. קריאת הערכים מהפוטנציומטרים (0-1023) והמרתם ל-0-255
  //transmitterdat.throttle = map(readStable(POT_THROTTLE), 0, 1023, 0, 255);
  //transmitterdat.steering = map(readStable(POT_STEERING), 430, 700, 0, 255);
  //transmitterdat.trimT = map(readStable(POT_TRIM_T), 0, 1023, 0, 255);
  //transmitterdat.trimS = map(readStable(POT_TRIM_S), 0, 1023, 0, 255);
  int mappedValue;
  mappedValue = map(readStable(POT_THROTTLE), 370, 650, 0, 255);
  transmitterdat.throttle = constrain(mappedValue, 0, 255);
  
  // 1. קריאה ומיפוי לתוך משתנה זמני שיכול להכיל מספרים מחוץ לטווח 0-255
  mappedValue = map(readStable(POT_STEERING), 430, 700, 0, 255);
  // 2. הגבלה (Constrain) כשהערך עדיין בתוך ה-INT
  // 3. ורק אז שמירה לתוך ה-struct (מסוג byte)
  transmitterdat.steering = constrain(mappedValue, 0, 255);

  // דוגמה לטרים
  mappedValue = map(readStable(POT_TRIM_T), 0, 1023, 0, 255);
  transmitterdat.trimT = constrain(mappedValue, 0, 255);

  // דוגמה לטרים
  mappedValue = map(readStable(POT_TRIM_S), 0, 1023, 0, 255);
  transmitterdat.trimS = constrain(mappedValue, 0, 255);

  
/*
  transmitterdat.throttle = 100;
  transmitterdat.steering = 250;
  transmitterdat.trimT = 200;
  transmitterdat.trimS = 127;
*/
  // 2. חישוב ה-Checksum לאימות הנתונים בצד השני
  transmitterdat.checksum = (byte)(transmitterdat.throttle + transmitterdat.steering + 
                                   transmitterdat.trimT + transmitterdat.trimS);

  // 3. שידור המבנה המלא ל-LoRa
  loraSerial.write((byte*)&transmitterdat, sizeof(ControlData));

  // הדפסה לדיבאג (אופציונלי)
  debugPrint();

  // השהייה קטנה לקביעת קצב השידור (כ-20 פעמים בשנייה)
  delay(50);
}

int readStable(int pin) {
  long sum = 0;
  for (int i = 0; i < 15; i++) { // לוקחים 10 דגימות
    sum += analogRead(pin);
  }
  return sum / 15; // מחזירים את הממוצע
}

void debugPrint() {
  static unsigned long lastDebug = 0;
  if (millis() - lastDebug > 500) {
    /*
    Serial.print("Sending -> T: "); Serial.print(transmitterdat.throttle);
    Serial.print(" S: "); Serial.println(transmitterdat.steering);
    */
    //Serial.print("Sending -> Throttle: "); Serial.println(readStable(POT_THROTTLE));
    Serial.print("Sending -> Final Throttle: "); Serial.println(transmitterdat.throttle);
    
    //Serial.print("Sending -> Steering: "); Serial.println(readStable(POT_STEERING));
    Serial.print("Sending -> Final Steering: "); Serial.println(transmitterdat.steering);

    //Serial.print("Sending -> TrimT: "); Serial.println(readStable(POT_TRIM_T));
    Serial.print("Sending -> Final TrimT: "); Serial.println(transmitterdat.trimT);
    
    //Serial.print("Sending -> TrimS: "); Serial.println(readStable(POT_TRIM_S));
    Serial.print("Sending -> Final TrimS: "); Serial.println(transmitterdat.trimS);

    Serial.println("________ ");
    lastDebug = millis();
  }
}

